  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The original building outlines were created
  from the 2005 Pictometry aerial imagery. The Building Class field was added from
  the 2011 Community Basemap project and the type 'apartment' was added to that domain
  in 2011. New building outlines were acquired from the 2011-2012 Pictometry flight
  and replaced the whole layer joining previous attribute information where possible.
  \ The latest building outlines were captured from the 2014 Pictometry flight and
  include fields for change detection.  Use the Status field to exclude Demolished
